import CallEndIcon from '@material-ui/icons/DeleteTwoTone/CallEnd';

const RoomHeader = () => {
    return(
      <div id = "toolbar">
        <ul className="nav">
        <li className="nav-item">
          <button>
            <CallEndIcon/>
          </button>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Link</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Link</a>
        </li>
        <li className="nav-item">
          <a className="nav-link disabled" href="#">Disabled</a>
        </li>
        </ul>
      </div>
  );
}
export default RoomHeader;
